import "./ManCalllistPage.css";

function Man_CalllistPage() {
  return (
    <div className="container">
      <h1 className="title">통화</h1>
      <div className="button-container">
        <button>통화 전체 목록</button>
        <button>부재중 조회</button>
        <button>고객 조회</button>
        <button>키워드 조회</button>
      </div>
    </div>
  );
}

export default Man_CalllistPage;
